import React from 'react'
import {IoLogoPinterest} from "react-icons/io";

const _stylesNavLeft = {
    iconContainerLeft:{
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'center',
        alignItems: 'center'
    },
    iconPinterest:{
        width: '35px',
        height: '35px',
        borderRadius: '33px',
        color: 'red',
        cursor: 'pointer',
    },
    iconLeft:{
        color: 'white',
        textDecoration: 'none',
    },
    iconInicio:{
        width: '35px',
    }
    };
function PinIconNavLeft() {
    return (
        <div style={_stylesNavLeft.iconContainerLeft}>
            <IoLogoPinterest style={_stylesNavLeft.iconPinterest}/>
            <div style={_stylesNavLeft.iconInicio}>
                <a style={_stylesNavLeft.iconLeft} href="#">Hoy</a>
            </div>
        </div>
    )
}

export default PinIconNavLeft;
